import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import {
  Box,
  Grid,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography
} from "@material-ui/core";
import project1 from "../images/html-css-javascript-lg.jpg";
import Navbar from "./Navbar";

const useStyles = makeStyles({
  mainContainer: {
    background: "#233",
    height: "100%"
  },
  cardContainer: {
    maxWidth: 345,
    margin: "3rem",
    margin: "5rem auto"
  }
});

const Portfolio = () => {
  const classes = useStyles();

  return (
    <Box component="div" className={classes.mainContainer}>
      <Navbar />
      Hello from Portfolio component
      <Grid container justify="center" align="center">
        {/* Project 1 */}
        <Grid align="center" item xs={12} sm={8} md={6}>
          <Card className={classes.cardContainer}>
            <CardActionArea>
              <CardMedia
                component="img"
                alt="Contemplative Reptile"
                height="140"
                image={project1}
                title="Contemplative Reptile"
              >
                <CardContent>
                  <Typography gutterBottom variant="h5">
                    Project 1
                  </Typography>
                  <Typography
                    variant="body2"
                    color="textSecondary"
                    component="p"
                  >
                    Lorem ipsum dolor sit amet consectetur adipisicing elit. Non
                    at facere nemo in adipisci minus reprehenderit repellendus
                    iste, nisi vel ipsum consequuntur asperiores, saepe
                    praesentium deleniti rerum minima accusamus tenetur.
                  </Typography>
                </CardContent>
              </CardMedia>
            </CardActionArea>
          </Card>
        </Grid>
        {/* Project 2 */}
      </Grid>
    </Box>
  );
};

export default Portfolio;
